import React from 'react';
import styled from 'styled-components';

import Charly from '../Partials/Hero'

const Container = styled.div`
	background-repeat: no-repeat;
	background-position: center;
	height: 100%;
	text-align: center;
`;


const home = (props) => (
	<Container>
		<Charly />
	</Container>
)

export default home;
